import React from 'react';

function Levels() {
    for (var i=0; i<100; i++) {
        var element = <button type="button">{i}</button>
        document.getElementById('levels').appendChild(element);
    }
    return(
        <div id="levels">
            
        </div>
    )
}

export default Levels;
